import React from 'react';
import Button from '@material-ui/core/Button';
import Paper from '@material-ui/core/Paper';
import Grid from '@material-ui/core/Grid';
import ControlPointIcon from '@material-ui/icons/ControlPoint';
import TextField from '@material-ui/core/TextField';
import Stepper from '@material-ui/core/Stepper';
import Step from '@material-ui/core/Step';
import StepLabel from '@material-ui/core/StepLabel';
import { makeStyles } from '@material-ui/core/styles';
import './index.scss';

const useStyles = makeStyles((theme) => ({
  image: {
    backgroundImage: 'url(https://source.unsplash.com/random)',
    backgroundColor:
      theme.palette.type === 'light' ? theme.palette.grey[50] : theme.palette.grey[900],
    backgroundSize: 'cover',
    backgroundPosition: 'center',
  },
  paper: {
    margin: theme.spacing(8, 4),
    display: 'flex',
    flexDirection: 'column',
    alignItems: 'center',
  },
  logoBig:{
    marginTop: 22,
    marginBottom: 40,
    backgroundColor: '#DEDEDE',
    color: '#FFFFFF',
  },
 loginButton: {
    backgroundColor: '#4E5674',
    borderRadius: 10,
    width: 150,
    height: 50,
  },
  root: {
    width: '100%',
  },
}));

function getSteps() {
  return ['Primer paso', 'Segundo paso', 'Tercer paso', 'Cuarto paso'];
}

function getStepContent(stepIndex) {
  switch (stepIndex) {
    case 0:
      return 'Select campaign settings...';
    case 1:
      return 'What is an ad group anyways?';
    case 2:
      return 'This is the bit I really care about!';
    default:
      return 'Unknown stepIndex';
  }
}

export const RegisterThree = () => {
  const classes = useStyles();
  const [activeStep, setActiveStep] = React.useState(0);
  const steps = getSteps();

  const handleNext = () => {
    setActiveStep((prevActiveStep) => prevActiveStep + 1);
  };

  const handleBack = () => {
    setActiveStep((prevActiveStep) => prevActiveStep - 1);
  };

  const handleReset = () => {
    setActiveStep(0);
  };

  return (
    <Grid container component="main" className={classes.root}>

      <Grid item xs={false} sm={3} md={3} className={classes.image} />
      <Grid item xs={12} sm={9} md={9} component={Paper} elevation={6} square>
        <div className={classes.paper}>
          <Button variant="contained" className={classes.logoBig}>Logo</Button>

          <Stepper activeStep={activeStep} alternativeLabel>
            {steps.map((label) => (
              <Step key={label}>
                <StepLabel>{label}</StepLabel>
              </Step>
            ))}
          </Stepper> 

          <form className={classes.form} noValidate>
          <p className='textFb'>Facebook</p>
          <TextField
              variant="outlined"
              margin="normal"
              required
              id="email"
              label="Usuario"
              name="email"
              autoComplete="email"
              className='field'
            />

          <p className='textRs'>Redes Sociales</p>
          <TextField
              variant="outlined"
              margin="normal"
              required
              id="email"
              label="Usuario"
              name="email"
              autoComplete="email"
              className='field'
            />
          </form> 
            <ControlPointIcon/>

            <div className='login'>
              <Button
                type="submit"
                variant="contained"
                color="primary"
                className={classes.loginButton}
              >
                Siguiente
              </Button>  
            </div>
        </div>
      </Grid>
    </Grid>    
  );
}
